import { Route, Switch } from 'react-router-dom'
import Home from './Home/Home';
import Test from './Test';

const App = () => {
  return (
    <>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/test" exact component={Test} />
      </Switch>
    </>
  );
}

export default App;
